import React from "react";
import "./Top.css";

const Top = props => {

  return (
    <div className="App">
      <div className="main-wrapper">
        <ol>
            <li>{props.top_track_items[0].name} {" by "} {props.top_track_items[0].artists[0].name}</li>
            <li></li>
        </ol>
        <div className="first-top-track">
            {props.top_track_items[0].name} {" by "} {props.top_track_items[0].artists[0].name}
        </div>
        <div className="2nd top track">
            {props.top_track_items[1].name} {" by "} {props.top_track_items[1].artists[0].name}
        </div>
        <div className="3rd top track">
            {props.top_track_items[2].name} {" by "} {props.top_track_items[2].artists[0].name}
        </div>
        <div className="4th top track">
            {props.top_track_items[3].name} {" by "} {props.top_track_items[3].artists[0].name}
        </div>
        <div className="5th top track">
            {props.top_track_items[4].name} {" by "} {props.top_track_items[4].artists[0].name}
        </div>
      </div>
    </div>
  );
}

export default Top;
